import React from "react";
import { Text, StyleSheet, View, TextInput } from "react-native";

const NoteScreen = () => {
  return (
    <View
      style={{
        padding: 30,
        margin: 10,
        borderColor: "blue",
        borderWidth: 2,
        borderRadius: 5,
      }}
    >
      <View>
        <TextInput></TextInput>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({});
export default NoteScreen;
